import {
  Box,
  Card,
  CardContent,
  CardMedia,
  Container,
  Divider,
  Grid,
  Typography,
} from "@mui/material";
import React from "react";
import Announcement from "../components/Announcement";
import Footer from "../components/Footer";
import Navbar from "../components/Navbar";
import Newsetter from "../components/Newsetter";
import { SliderData } from "../data";

const Cart = () => {
  const data = SliderData;
  return (
    <Box>
      <Announcement />
      <Navbar />
      <Container>
        <Typography variant="h3" sx={{ textAlign: "center" }}>
          Shopping Cart
        </Typography>
        <Typography variant="h5">3 Items in Cart</Typography>
        <Divider />
        <Grid container spacing={2}>
          <Grid item sm={12} md={9}>
            <Card>
              <CardMedia
                component="img"
                sx={{ width: 151 }}
                image={data[0].imgSrc}
                alt="Live from space album cover"
              />
            </Card>
            <CardContent>
              <Typography variant="subtitle1" component="p">
                Live From Space
              </Typography>
              <Typography
                variant="subtitle2"
                color="text.secondary"
                component="p"
              >
                {data[0].description}
              </Typography>
            </CardContent>
          </Grid>
          <Grid item sm={12} md={3}></Grid>
        </Grid>
      </Container>
      <Newsetter />
      <Footer />
    </Box>
  );
};

export default Cart;
